const palette = {
    charcoal1: "#3a3a3a",
    charcoal1Transparent: "rbga(58, 58, 58, 0.5)",
    charcoal2: "#dcdcdc",

    teal1: "rgb(95, 185, 243)",

    black1: "#000",

    white1: "#FFFFFF"
}

export default palette;
